import styled from 'styled-components';

export const Head = styled.section`
  width: 100%;
  height: 65px;
  border-bottom: 1px solid;
  display: flex;
  justify-content: space-around;
`;

export const Logo = styled.div`
  width: 30%;
  font-size: 2rem;
`;

export const Login = styled.div``;
